const debug = require('debug')('daedalus:metadata');
const fs = require('fs');
const diff = require('diff');
const urihooks = require('urihooks');
const { getDateDiff } = require('../../common/format.js');

function diffJSON(o, n) {
  if (typeof o === 'string') {
    return diff.diffLines(o, n);
  }
  return diff.diffJson(o, n);
}

function actionFromChange(x) {
  if (x.deleted) {
    return 'deleted';
  }
  if (x.row_number === '1') {
    return 'added';
  }
  return 'changed';
}

function renderDiff(row) {
  return row.row_number === '1'
    ? JSON.stringify(row.definition, null, 2)
    : diffJSON(row.old_definition, row.definition)
      .filter((x) => x.added || x.removed)
      .map((x) => x.value.split('\n').map((y) => (x.added ? '+' : '-') + y).join('\n'))
      .join('\n')
      .replace(/\n\+\n/g, '\n')
      .replace(/\n-\n/g, '\n')
      .replace(/\n\+$/g, '\n')
      .replace(/\n-$/g, '\n');
}

async function notify(pgpool) {
  if (process.env.SMTP && process.env.SMTP_FROM) {
    debug('Sending out change notifications...');
    const changes = (await pgpool.query(`
      select
        change_log_cache.*,
        users.user,
        users.name as username,
        users.email
      from
        metadata.change_log_cache
          join metadata.favorites on favorites.node = change_log_cache.node
          join metadata.users on users.user = favorites.user
          left join metadata.notifications on notifications.user = users.user and notifications.node_log = change_log_cache.node_log
      where
        notifications.created is null
        and favorites.created < change_log_cache.observed_on
    `)).rows;
    const emails = changes.map((x) => x.email).filter((v, i, s) => s.indexOf(v) === i);
    await Promise.all(emails.map(async (email) => {
      const html = `
        <html>
        <head>
          <meta name="color-scheme" content="light">
          <meta name="supported-color-schemes" content="light">
          <style type="text/css">
            :root {
              color-scheme: light;
              supported-color-schemes: light;
            }
            body {
              background: -moz-radial-gradient(center, ellipse cover, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 72%, rgba(255,255,255,1) 76%, rgba(233,233,233,1) 100%); /* ff3.6+ */
              background: -webkit-gradient(radial, center center, 0px, center center, 100%, color-stop(0%, rgba(255,255,255,1)), color-stop(72%, rgba(255,255,255,1)), color-stop(76%, rgba(255,255,255,1)), color-stop(100%, rgba(233,233,233,1))); /* safari4+,chrome */
              background:-webkit-radial-gradient(center, ellipse cover, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 72%, rgba(255,255,255,1) 76%, rgba(233,233,233,1) 100%); /* safari5.1+,chrome10+ */
              background: -o-radial-gradient(center, ellipse cover, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 72%, rgba(255,255,255,1) 76%, rgba(233,233,233,1) 100%); /* opera 11.10+ */
              background: -ms-radial-gradient(center, ellipse cover, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 72%, rgba(255,255,255,1) 76%, rgba(233,233,233,1) 100%); /* ie10+ */
              background:radial-gradient(ellipse at center, rgba(255,255,255,1) 0%, rgba(255,255,255,1) 72%, rgba(255,255,255,1) 76%, rgba(232,232,232,1) 100%); /* w3c */
              filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#ffffff', endColorstr='#efefef',GradientType=1 ); /* ie6-9 */
            }
            pre {
              max-height:200px;
              overflow: auto;
              max-width:800px;
              background-color:#fff !important;
              color:#444;
              padding:0.5rem 0.25rem;
              margin:0.25rem auto;
              box-shadow:0 1px 2px rgba(153,153,153,.35);
              border-top: 0.5px solid rgba(153,153,153,.2);
              border-radius:3px;
            }
            h4 {
              color:#333;
            }
            h4 > a {
              color:#333 !important;
              text-decoration: none;
            }
            pre > code {
              padding:0.5rem 0.25rem;
            }
            img.logo {
              margin-left:auto;
              margin-right:auto;
              max-width:150px;
              min-width:150px;
              max-height:150px;
              min-height:150px;
            }
            a[x-apple-data-detectors] {
              color: inherit !important;
              text-decoration: none !important;
              font-size: inherit !important;
              font-family: inherit !important;
              font-weight: inherit !important;
              line-height: inherit !important;
            }
          </style>
        </head>
        <body>
          <center>
            <div style="padding:1rem;border-bottom:1.5px solid #efefef;margin:0.5rem;border-radius:3px;">
              <img class="logo" src="data:image/png;base64,">
              <br>
              <img style="width:150px" src="data:image/png;base64,">
              <h3 style="font-weight:300;">Oh Hey! We found some changes</h3>
            </div>
          </center>
        ${changes
    .filter((change) => change.email === email)
    .map((change) => `
          <h4>${change.name} ${change.node_type.split('/').join(' ')} ${actionFromChange(change)}</h4>
          <pre style="background-color:#fff;"><code>${renderDiff(change)}</code></pre>
          <p>${getDateDiff(new Date(change.observed_on))}</p>
          <br/>
      `).join('')}
        </body>
        </html>
      `;

      const text = `Oh Hey! We found some changes.\n\n${changes
        .filter((change) => change.email === email)
        .map((change) => `
        ${change.name} ${change.node_type.split('/').join(' ')} ${actionFromChange(change)}
        ---
        ${renderDiff(change)}
        ---
        ${getDateDiff(new Date(change.observed_on))}

      `).join('')}`;
      const subject = 'Daedalus found some changes.';
      await urihooks.fire(0, `mailto:${email}`, 'changes', { html, text, subject });
      await Promise.all(changes.map((change) => pgpool.query('insert into metadata.notifications ("user", node_log, created) values ($1, $2, now())',
        [change.user, change.node_log])));
    }));
    debug('Sending out change notifications... done');
  }
}

async function run(pgpool) {
  if (process.env.METADATA !== 'true') {
    return;
  }
  debug('Running metadata plugin...');
  debug('Refreshing nodes_log cache...');
  await pgpool.query('refresh materialized view concurrently metadata.nodes_log_cache');
  debug('Refreshing nodes cache...');
  await pgpool.query('refresh materialized view concurrently metadata.nodes_cache');
  debug('Refreshing change log cache...');
  await pgpool.query('refresh materialized view concurrently metadata.change_log_cache');
  debug('Re-indexing parent familial relationships...');
  await pgpool.query('reindex index concurrently metadata.metadata_families_parent');
  debug('Re-indexing child familial relationships...');
  await pgpool.query('reindex index concurrently metadata.metadata_families_child');
  debug('Re-indexing parent-child familial relationships...');
  await pgpool.query('reindex index concurrently metadata.families_node_idx');

  await notify(pgpool);
}

async function init(pgpool) {
  debug('Initializing metadata plugin...');
  await pgpool.query(fs.readFileSync('./plugins/metadata/create.sql').toString());
  debug('Initializing metadata plugin... done');
}

module.exports = {
  name: 'metadata',
  run,
  init,
};
